create or replace function tenantsetchannels(
    _data jsonb,
    _params jsonb,
    _operator jsonb
) returns jsonb
    language plpgsql
as
$$
DECLARE
    aux numeric;
    C jsonb;
    V jsonb;
    _tmdb jsonb;
    _meta jsonb;
    _channelid numeric;
    _urlicon varchar = 'https://assets.xisrv.xyz/images/';
    i numeric = 1;
BEGIN
    raise notice 'start';
    for C in select jsonb_array_elements((_data->>'channels')::jsonb) loop
        select count(*) into aux from channels where channelid = (C->>'channelid')::numeric;
        raise notice 'Exists: %', aux;
        if (aux = 0) then
            insert into channels (channelid, categoryid, name, sources, icon, status, path, urlpath, playmode, direct_source, url_source,sourcetype,
                                  originvideos, orden, tvshowid, fromastra)
            values ((C->>'channelid')::numeric, (C->>'categoryid')::jsonb, C->>'name', (C->>'sources')::jsonb,
                    C->>'icon', C->>'status', C->>'path',
                    C->>'urlpath', C->>'playmode',(C->>'direct_source')::numeric,  (C->>'url_source')::jsonb,C->>'sourcetype',
                    (C->>'totalvideos')::numeric,(C->>'orden')::numeric,(C->>'tvshowid')::numeric,(C->>'fromastra')::bool);
        else
            update channels
            set name = C->>'name',path = C->>'path',
                urlpath = C->>'urlpath',
                sourcetype = C->>'sourcetype', --status = C->>'status',
                localpath = C->>'localpath',
                direct_source = (C->>'direct_source')::numeric,
                icon = C->>'icon',
                playmode = C->>'playmode',
                url_source =(C->>'url_source')::jsonb,
                categoryid =(C->>'categoryid')::jsonb,
                originvideos = (C->>'totalvideos')::numeric,
                orden = (C->>'orden')::numeric,
                tvshowid =(C->>'tvshowid')::numeric,
                fromastra =(C->>'fromastra')::bool
            where channelid = (C->>'channelid')::numeric;
        end if;
        for V in select jsonb_array_elements(((C->>'videos')::jsonb->>'channelvideos')::jsonb) loop
            select count(*) into aux from videos where (id = (V->>'id')::numeric or filename = (V->>'name'));
            raise notice 'Video Exists: %', aux;
            if ((V->>'tmdb')::jsonb is null) then
                _tmdb = ('{}')::jsonb;
            else
                _tmdb =(V->>'tmdb')::jsonb;
            end if;
            if ((V->>'meta')::jsonb is null) then
                _meta = ('{}')::jsonb;
            else
                _meta =(V->>'meta')::jsonb;
            end if;
            if (aux = 0) then
                insert into videos (id, name, type, tmdb_id, tmdb, tmdb_rank, url,httpcode,
                        meta, season, episode, filename, originalname, localtodo, ext, bucket, cloudpath, localpath,
                        downloadstatus, status, tvshowid)
                values ((V->>'id')::numeric, V->>'name', V->>'type', V->>'tmdb_id',_tmdb, (V->>'tmdb_rank')::numeric, V->>'url',(V->>'httpcode')::numeric,
                       _meta, (V->>'season')::numeric, (V->>'episode')::numeric, V->>'filename', V->>'originalname', V->>'localtodo', V->>'ext',
                        V->>'bucket', V->>'cloudpath', V->>'localpath',
                        'pending', V->>'status',(C->>'tvshowid')::numeric);
                insert into channelvideos (channelid, id, obs, status, orden)
                values ((C->>'channelid')::numeric,(V->>'id')::numeric,'','loaded',i);
                i = i+1;
            else
                update videos
                    set meta = _meta,
                        tmdb_id = V->>'tmdb_id',
                        tmdb_rank = (V->>'tmdb_rank')::numeric,
                        tmdb = _tmdb,
                        httpcode = (V->>'httpcode')::numeric,
                        type = V->>'type',
                        name =V->>'name',
                        url = V->>'url',
                        tvshowid = (C->>'tvshowid')::numeric,
                        bucket = V->>'bucket',
                        cloudpath = V->>'cloudpath',
                        localpath = V->>'localpath',
                        season = (V->>'season')::numeric,
                        episode = (V->>'episode')::numeric,
                    modified_at = current_timestamp
                where filename = (V->>'name');

                select count(*) into aux from channelvideos where channelid= (C->>'channelid')::numeric
                    and id = (V->>'id')::numeric;
                if (aux =0) then
                    insert into channelvideos (channelid, id, obs, status, orden)
                    values ((C->>'channelid')::numeric,(V->>'id')::numeric,'','loaded',i);
                    i = i+1;
                end if;
            end if;
        end loop;
    end loop;
    return '{"status":"success"}';
END;
$$;

